</td>
<td>This category is for the blocked sock puppets of sockpuppeteers who evidently have contravened against one or more of the following rules:
<hr>
<p><i>"The general rule is one editor, one account. Do not use multiple accounts to mislead, deceive, or disrupt; to create the illusion of greater support for a position; to stir up controversy; or to circumvent a block, ban, or sanction. Do not ask your friends to create accounts to support you. Do not revive old unused accounts and use them as different users, or use another person's account. Do not log out just to vandalise as an IP address editor."</i>
</p>
<hr>
<p>For further information, take a look at <a href="Wikipedia%3ASock_puppetry.html" class="extiw" title="wikipedia:Wikipedia:Sock puppetry">Wikipedia:Sock puppetry</a>
</p>
<hr>
<p><a href="fonts/File%3ACommons-checkuser.svg" class="image"><img alt="Commons-checkuser.svg" src="images/24px-Commons-checkuser.svg.png" width="24" height="23" srcset="https://upload.wikimedia.org/wikipedia/commons/thumb/b/b8/Commons-checkuser.svg/36px-Commons-checkuser.svg.png 1.5x, https://upload.wikimedia.org/wikipedia/commons/thumb/b/b8/Commons-checkuser.svg/48px-Commons-checkuser.svg.png 2x" data-file-width="118" data-file-height="113"></a> To report a sock on Commons, please see the header at <a href="/wiki/Commons:Sockpuppet_investigations" title="Commons:Sockpuppet investigations">Commons:Sockpuppet investigations</a>
</p>
